// "After the removal of the ten tribes into Medea and Mesopotamia, a part of them thence removed to a place on the Oxus?, now called Hazeras; & Hazereth, no doubt, the Arsareth of Esdras. Thence they extended into Transoxiana, by corruption called Sogdiana.  They gave name to Chorazon, after a city of that name on the east of the Dead Sea, the country from whence they had been removed by the Assyrians; also Calhgar?, for Arhur?; - Samarcand, by corruption, for Samaria; and Eighur, by corruption, for Igor.  They settled upon the mountains between India and Persia, and upon the heads of the Indus?, as far as to Kholen, in the Icfser? Bucharia.  The descendants of Dan, Asher, Zebulon, and Napthali; are there plainly distinguishable at this day.  The Affghans, on the heads of the Indus?, are descended of the Hebrews.  Their language is evidently a dialect of the scriptural Chaldaic.  The people in all these countries have been distinguished, by the earliest profane historians, by their knowledge & use of letters.  These the Hebrews, the first settlers of the country, planted there at least from the time of their arrival.  The neighboring
